import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import ScrollAnimation from 'react-animate-on-scroll';


ReactDOM.render(<ScrollAnimation animateIn="fadeIn"><App /></ScrollAnimation>, document.getElementById('root'));
